import React from 'react';
import Layout from '../../components/Layout'
import {Form,Button} from 'semantic-ui-react'
import DatePicker from "react-datepicker";
import Calendar from 'react-calendar';
//import "react-datepicker/dist/react-datepicker.css";
class newTender extends React.Component{
	state = {
    	startDate: new Date()
  	};
  	handleChange = date => {
    	this.setState({
      	startDate: date
    	});
	};
	render(){
		return(
			<Layout>
				<div>
				</div>
				<Form>
    				<Form.Field>
      					<label>Tender Subject</label>
      					<input placeholder='Tender Subject' />
    				</Form.Field>
    				<Form.Field>
      					<label>Tender Type</label>
      					<input placeholder='Tender Type' />
    				</Form.Field>
    				<Form.Field>
      					<label>Tender Receving Location</label>
      					<input placeholder='Tender Receving Location' />
    				</Form.Field>
    				<Form.Field>
      					<label>Max Bid Value</label>
      					<input placeholder='Max Bid Value' />
    				</Form.Field>
    				<Form.Field>
    					<label>tender closing date</label>
    					<Calendar
          				onChange={this.handleChange}
          				value={this.state.date}
        				/>
    				</Form.Field>
    				<Button primary type='submit'>Submit</Button>
  				</Form>
			</Layout>
			)
	}
}
export default newTender;
